import { NavLink } from "react-router-dom";

export default function Navbar() {
    return (
        <>
            <nav class="navbar navbar-white border border-bottom-2 bg-white">
                <div class="container-fluid">
                <div class="container">
                    <img src="/navbarLogo.png" alt="MVP Logo" />
                </div>
                </div>
            </nav>  
        </>
    )
}
